import React from "react";
import ReactDOM from "react-dom";
import { Button } from '@material-ui/core';

function Test() {
  return <Button color="primary">Hello World</Button>;
}

import App from "./App";

const rootElement = document.getElementById("root");
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  rootElement
);
